import Sidebar from './Sidebar';
import Header from './Header';
import '../styles/Layout.css'; // Add necessary styles

const Layout = ({ children }) => {
  return (
    <div className="layout">
      <Sidebar />
      <div className="main-content">
        <Header />
        <main>{children}</main>
      </div>
    </div>
  );
};

export default Layout;
